    temperature, salinity and other variables collected from discrete sample and profile
    observations using Alkalinity titrator, CTD and other instruments from the HUDSON
    in the Davis Strait, Labrador Sea and North Atlantic Ocean from 2011-05-06 to 2011-05-28
    (NODC Accession 0108124)",nt"tracking_summary": {ntt"total": 2,ntt"recent":
