    "2015-09-26T20:48:55.691656",nt"name": "dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro5147d",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0108124 includes chemical,
    discrete sample, physical and profile data collected from HUDSON in the Davis Strait,
    Labrador Sea and North Atlantic Ocean from 2011-05-06 to 2011-05-28 and retrieved
    during cruise 18HU20110506 (HUD2011-009). These data include ALKALINITY, AMMONIUM,
    DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE,
    PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE
    and pH. The instruments used to collect these data include Alkalinity titrator,
    CTD, Coulometer for DIC measurement and bottle. These data were collected by Kumiko
    Azetsu-Scott and Igor Yashayaev of Bedford Institute of Oceanography as part of
    the CLIVAR_AR07W_2011 data set.nnThe International CLIVAR Global Ocean Carbon and
    Repeat Hydrography Program carries out a systematic and global re-occupation of
    select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
    of heat, fresh water, carbon dioxide (CO2), and related parameters.",nt"license_title":
